import React from 'react';
import Header from "./Header";
import './App.css';
import LandingPadge from './landingPadge';
import { Router, Route, Switch } from "react-router";

function App() {
  return (
    <Router>
      <Route path="/" render={() => {
        <>
          <Header>
          </Header>
          <LandingPadge></LandingPadge>
          </>
      }}>
      </Route>
      </Router>
  );
}

export default App;
